    var iStates = {};
    iStates.draw = function (id, data, toolTip) {

        function mouseOver(d) {

            d3.select("#tooltip").transition().duration(200).style("opacity", .9);
            d3.select("#tooltip").html(toolTip(d.n, data[d.id]))
                .style("left", d3.event.layerX + "px")
                .style("top", d3.event.layerY + "px");
        }

        function mouseOut() {

            d3.select("#tooltip").transition().duration(500).style("opacity", 0);
        }

        d3.select(id).selectAll(".state")
            .data(apDistrictPaths).enter().append("path").attr("class", "state").attr("d", function (d) {

                return d.d;
            })
            .style("fill", function (d) {
                return data[d.id].color;
            })
            .attr("data-legend", function (d) {
                return d.n + " (" + data[d.id].Value + ")";
            })
            .on("mousemove", mouseOver).on("mouseout", mouseOut);
        //.on("mousemove", mouseOver).on("mouseout", mouseOut);
    };
    this.iStates = iStates;
